const Blogs = () => {
    return <h1>Blog Articles</h1>
    return (
        <>
            <Helmet>
                <meta charSet="utf-8" />
                <title>Contact Us</title>
                <link rel="canonical" href="http://mysite.com/example" />
            </Helmet>
            <h1>Contact Me</h1>
        </>

    )
};
export default Blogs;
